const sensorsList = [
    "62bf8fe319c7e66b1edbbb2e",
    "62c776cb657ab4d12277f1c8",
    "62c776cb657ab4d12277f1ca",
    "62c776cb657ab4d12277f1c7"
];

function processStations(stations) {
    return stations.reduce((acc, station) => {

        if (!(station.sensors && station.sensors.length > 0)) {
            return acc;
        };

        const { sensors, channels } = station.sensors.reduce((sensorAcc, sensor) => {
            if (!(sensor.channels && sensor.channels.length > 0)) {
                return sensorAcc;
            };

            const selectedSensor = sensorsList.some(sensId => sensId == (sensor._id || sensor.id))
            
            const validChannels = sensor.channels.reduce((channelAcc, ch) => {
                if (!(ch != null && typeof ch === 'object')) {
                    if(selectedSensor) console.log(ch)
                    return channelAcc;
                };

                const selectedChannel = sensorsList.some(sensId => sensId == ch.id)

                return [
                    ...channelAcc,
                    {
                        name: `${station.name}_${sensor.name}_${ch.name}_(${ch.unit['name']})`,
                        id: ch._id,
                        instrumentTypeId: station.instrumentType['_id'],
                        selected: selectedChannel,
                        disabled: false
                    }
                ];

            }, []);

            if (validChannels.length === 0) {
                return sensorAcc;
            };

            const sensorItem = {
                id: sensor._id,
                name: `${station.name}_${sensor.name}`,
                instrumentTypeId: station.instrumentType['_id'],
                selected: selectedSensor,
                disabled: false
            };

            sensorAcc.sensors.push(sensorItem);
            sensorAcc.channels.push(...validChannels);

            return sensorAcc;
        }, { sensors: [], channels: [] });

        const selectedStation = sensorsList.some(sensId => sensId == station.id)

        if (sensors.length) {
            const validStation = {
                name: station.name,
                id: station.id,
                instrumentTypeId: station.instrumentType['_id'],
                selected: selectedStation,
                disabled: false
            }
            acc.instrument.push(validStation)
        }

        acc.sensor.push(...sensors);
        acc.channel.push(...channels);

        return acc;
    }, { instrument: [], sensor: [], channel: [] });
};

processStations(stations)
